# imports some software packages we'll use
import math
import pandas as pd
import numpy as np
from math import cos,sin,pi,sqrt
import matplotlib as mpl
import matplotlib.pyplot as plt
from scipy.integrate import odeint
import scipy.signal as sis
from tabulate import tabulate

# Defining the constants
g = 9.8 # gravitational acceleration (m^2/s)
ω = 2*np.pi # drive frequency
ω0= 1.5*ω # natural frequency
l = 0.11 # length of the pendulum (m) got it from the equation g/L=w0^2
β = (ω0)/4 # damping constant
γ = 1.06 # drive strength


# Set the time range and step size
dt = 0.01 # time step in (s)
tmax = 50 # end of time (s)
t0 = 0 # start of time

# Define the equation of motion
# in the parameter y is an array of position and velocity
# 𝜱 is the positon , d𝜱 is the velocity
# d𝜱2 is the accleration and the outcome
def ddp_eq(t, 𝜱, d𝜱, γ, ω, ω0, β):
    d𝜱2 = -2 * β * d𝜱 - ω0**2 * np.sin(𝜱) + γ*ω0**2*np.cos(ω*t)
    return d𝜱2

# Initialize arrays
t = np.arange(t0, tmax, dt)
d𝜱 = np.zeros_like(t)
𝜱 = np.zeros_like(t)
d𝜱2 = np.zeros_like(t)
𝜱0 = np.pi/2

# Set the initial conditions
d𝜱[0] = 0
𝜱[0] = 𝜱0 # setting first element to 𝜱0

for i in range(1, len(t)):

    # Update Acceleration
    d𝜱2  = (ddp_eq(t[i], 𝜱[i-1], d𝜱[i-1] , γ, ω, ω0, β))

    # Update velocities
    d𝜱[i] = d𝜱[i-1] + d𝜱2 * dt

    # Update positions
    𝜱[i] = 𝜱[i-1] + d𝜱[i] * dt

headers=["Table", "Time", "Position" , "Velocity"]
data = pd.DataFrame({ "t":t,"𝜱":𝜱, "𝜱'": d𝜱})
print(tabulate(data, headers=headers, tablefmt='fancy_grid'))

# Plot the first ten cycles
print("\n")
fig, ax = plt.subplots()
ax.plot(t, 𝜱, color='blue')
ax.set_xlim(0, 10)
ax.set_xlabel('Time (s)')
ax.set_ylabel('Position')
ax.set_title('DDP First Ten Cycles')
plt.show()

print("\n")
# Plot the ten cycles from 40 to 50 seconds
fig, ax = plt.subplots()
ax.plot(t, 𝜱, color='blue')
ax.set_xlim(40, 50)
ax.set_xlabel('Time (s)')
ax.set_ylabel('Position')
ax.set_title('DDP Ten Cycles from 40 to 50 seconds')
plt.show()

print("\n")
# Plot the cycles from 0 to 50 seconds
fig, ax = plt.subplots()
ax.plot(t, 𝜱, color='blue')
ax.set_xlim(0, tmax)
ax.set_xlabel('Time (s)')
ax.set_ylabel('Position')
ax.set_title('DDP from 0 to 50 seconds')
plt.show()


peaks, _ = sis.find_peaks(𝜱)
period = np.mean(np.diff(t[peaks]))

# Print the period of the attractor
print("\n",f"The period of the attractor is {period/(2*np.pi):.2f} cycles.")

